package fr.acinq.eclair.wire.internal.channel.version2

import fr.acinq.bitcoin.{OutPoint, Transaction}
import fr.acinq.eclair.channel.{DATA_NORMAL, DATA_SHUTDOWN}
import fr.acinq.eclair.randomBytes32
import fr.acinq.eclair.wire.internal.channel.version2.ChannelCodecs2.Codecs._
import fr.acinq.eclair.wire.internal.channel.version2.ChannelCodecs2.stateDataCodec
import org.scalatest.funsuite.AnyFunSuite
import scodec.bits.HexStringSyntax

class ChannelCodecs2Spec extends AnyFunSuite {

  test("encode/decode map of spending txs") {
    val map = Map(
      OutPoint(randomBytes32(), 42) -> Transaction.read(""),
      OutPoint(randomBytes32(), 14502) -> Transaction.read(""),
      OutPoint(randomBytes32(), 0) -> Transaction.read(""),
      OutPoint(randomBytes32(), 454513) -> Transaction.read("")
    )
    assert(spentMapCodec.decodeValue(spentMapCodec.encode(map).require).require === map)
  }

  test("backward compatibility DATA_NORMAL_COMPAT_02_Codec") {
    val oldBin = hex"" ++ hex"" ++ hex""
    val decoded1 = stateDataCodec.decode(oldBin.bits).require.value
    assert(decoded1.asInstanceOf[DATA_NORMAL].closingFeerates === None)
    val newBin = stateDataCodec.encode(decoded1).require.bytes
    // make sure that encoding used the new codec
    assert(newBin.startsWith(hex"0007"))
    val decoded2 = stateDataCodec.decode(newBin.bits).require.value
    assert(decoded1 === decoded2)
  }

  test("backward compatibility DATA_SHUTDOWN_COMPAT_03_Codec") {
    val oldBin = hex""
    val decoded1 = stateDataCodec.decode(oldBin.bits).require.value
    assert(decoded1.asInstanceOf[DATA_SHUTDOWN].closingFeerates === None)
    val newBin = stateDataCodec.encode(decoded1).require.bytes
    // make sure that encoding used the new codec
    assert(newBin.startsWith(hex"0008"))
    val decoded2 = stateDataCodec.decode(newBin.bits).require.value
    assert(decoded1 === decoded2)
  }

}
